// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./token/ERC721/IERC721.sol";
import "./token/ERC721/extensions/IERC721Metadata.sol";
import "./token/ERC721/IERC721Receiver.sol";
import "./utils/introspection/ERC165.sol";
import "./utils/Address.sol";
import "./utils/Strings.sol";

contract Ideas is ERC165, IERC721, IERC721Metadata {

    using Address for address;
    using Strings for uint256;

    struct Idea {
        string name;
        uint256 price;
        address owner;
        address creator;
        Version[] versions;
    }

    struct Version {
        string hash;
        uint256 block_time;
    }

    modifier isContractOwner() {
        require(msg.sender == contractOwner, "Only contract owner is authorized to do this action");
        _;
    }

    modifier isAdmin() {
        require(msg.sender == admin, "Only admin is authorized to do this action");
        _;
    }

    modifier isProgrammer() {
        require(msg.sender == programmer, "Only programmer is authorized to do this action");
        _;
    }

    modifier isDevops() {
        require(msg.sender == devops, "Only Devops is authorized to do this action");
        _;
    }

    modifier isRegisteredWallet(address _wallet) {
        require(!_isEmpty(_wallets[_wallet]), "Wallet not registered.");
        _;
    }

    modifier isFreeIdea(uint256 tokenId) {
        require(_box[tokenId].price == 0, "Not a Free Idea");
        _;
    }

    modifier isTokenOwnerOrApproved(address sender, uint256 tokenId) {
        require(_isApprovedOrOwner(sender, tokenId), "User is not owner of the token");
        _;
    }

    string private constant _tokenName = "SCROLL";
    string private constant _tokenSymbol = "SCRL";
    string private baseURI;

    address contractOwner;
    address payable treasurer;
    address admin;
    address programmer;
    address devops;

    uint private txn_fees_percent = 10;
    uint256 public publish_fees;
    uint256 private _totalIdeas = 0;

    mapping(address => string) private _wallets;
    mapping(string => address) private _users;


    mapping(uint256 => Idea) private _box;
    mapping(address => uint256) private _balances;
    mapping(string => uint256) private _hashes;

    mapping (uint256 => address) private _tokenApprovals;
    mapping (address => mapping (address => bool)) private _operatorApprovals;

    constructor (address _contractOwner,
        address _treasurer,
        address _admin,
        address _programmer,
        address _devops,
        uint256 _publish_fees,
        string memory _baseURI) {

        contractOwner = _contractOwner;
        treasurer = payable(_treasurer);
        admin = _admin;
        programmer = _programmer;
        devops = _devops;
        publish_fees = _publish_fees;
        baseURI = _baseURI;
    }

    function name() public view virtual override returns (string memory) {
        return _tokenName;
    }

    function symbol() public view virtual override returns (string memory) {
        return _tokenSymbol;
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");

        return bytes(baseURI).length > 0
        ? string(abi.encodePacked(baseURI, tokenId.toString()))
        : '';
    }

    function getContractOwner() public view returns (address) {
        return contractOwner;
    }

    function getTreasurer() public view returns (address) {
        return treasurer;
    }

    function getAdmin() public view returns (address) {
        return admin;
    }

    function getDevops() public view returns (address) {
        return devops;
    }

    function set_txn_fees_percent(uint _txn_fees_percent) public virtual isAdmin {
        txn_fees_percent = _txn_fees_percent;
    }

    function set_publish_fees(uint _publish_fees) public virtual isAdmin {
        publish_fees = _publish_fees;
    }

    function set_contract_owner(address _contractOwner) public virtual isContractOwner {
        contractOwner = _contractOwner;
    }

    function set_treasurer(address _treasurer) public virtual isContractOwner {
        treasurer = payable(_treasurer);
    }

    function set_admin(address _admin) public virtual isContractOwner {
        admin = _admin;
    }

    function set_programmer(address _programmer) public virtual isContractOwner {
        programmer = _programmer;
    }

    function set_devops(address _devops) public virtual isContractOwner {
        devops = _devops;
    }

    function set_baseURI(string memory _baseURI) public virtual isAdmin {
        baseURI = _baseURI;
    }

    function set_price(uint256 tokenId, uint256 _price) public virtual isTokenOwnerOrApproved(_msgSender(), tokenId) {
        Idea storage idea = _box[tokenId];
        require(!_isEmpty(idea.name), "Ideas: Idea with id does not exist");
        idea.price = _price;
    }

    function register_user(address _address, string memory _name) payable public virtual isProgrammer {
        require(!_isEmpty(_name), "Ideas: User Name cannot be empty");
        require(_address != address(0), "Ideas: Wallet cannot be zero address");
        require(_isEmpty(_wallets[_address]), "Ideas: Wallet already registered");
        require(_users[_name] == address(0), "Ideas: Username already registered");
        _wallets[_address] = _name;
        _users[_name] = _address;
    }

    function publish(string memory _name, string memory hash, uint256 price) payable public virtual isRegisteredWallet(_msgSender()) returns (uint256) {
        require(!_isEmpty(_name), "Ideas: Idea Name cannot be empty");
        require(!_isEmpty(hash), "Ideas: Idea hash cannot be empty");
        require(_hashes[hash] == 0, "Ideas: Idea hash already present");
        require(msg.value >= publish_fees, "Ideas: Publish fees sent less than expected");

        _totalIdeas += 1;
        address creator = _msgSender();
        _safeMint(creator, _totalIdeas, Idea(_name, price, creator, creator, new Version[](0)), Version(hash, block.timestamp));
        return _totalIdeas;
    }

    function transferToTreasurer(uint256 amount) public virtual isAdmin {
        treasurer.transfer(amount);
    }

    function publishOnBehalf(string memory _name, string memory hash, uint256 price, address creator) public virtual isProgrammer isRegisteredWallet(creator) returns (uint256) {
        require(!_isEmpty(_name), "Ideas: Idea Name cannot be empty");
        require(!_isEmpty(hash), "Ideas: Idea hash cannot be empty");
        require(_hashes[hash] == 0, "Ideas: Idea hash already present");
        _totalIdeas += 1;
        _safeMint(creator, _totalIdeas, Idea(_name, price, creator, creator, new Version[](0)), Version(hash, block.timestamp));
        return _totalIdeas;
    }

    function extend(uint256 tokenId, string memory hash) payable public virtual isTokenOwnerOrApproved(_msgSender(), tokenId) {
        require(!_isEmpty(hash), "Ideas: Idea hash cannot be empty");
        require(_hashes[hash] == 0, "Ideas: Idea hash already present");
        require(msg.value >= publish_fees, "Ideas: Publish fees sent less than expected");
        require(!_isEmpty(_box[tokenId].name), "Ideas: Idea with id does not exist");

        Version memory version = Version(hash, block.timestamp);
        _box[tokenId].versions.push(version);
    }

    function buy(uint256 tokenId) payable public virtual {
        Idea memory idea = _box[tokenId];
        require(!_isEmpty(idea.name), "Ideas: Idea with id does not exist");
        require(idea.owner != msg.sender, "Ideas: Buyer is already owner");
        require(idea.price > 0, "Ideas: Idea cannot be bought");
        require(msg.value >= idea.price, "Ideas: Transferred ETH is less than price of Idea");
        address previous_owner = idea.owner;
        _safeTransfer(previous_owner, _msgSender(), tokenId, "");
        uint256 txn_fees = (txn_fees_percent * msg.value) / 100;
        payable(previous_owner).transfer(idea.price - txn_fees);
        if (msg.value > idea.price) {
            payable(_msgSender()).transfer(msg.value - idea.price);
        }
    }

    function safeTransfer(address to, uint256 tokenId) public virtual {
        safeTransferFrom(_msgSender(), to, tokenId);
    }

    function safeTransferFrom(address from, address to, uint256 tokenId) public virtual override {
        safeTransferFrom(from, to, tokenId, "");
    }

    function safeTransferFrom(address from, address to, uint256 tokenId, bytes memory _data) public virtual override {
        require(_isApprovedOrOwner(_msgSender(), tokenId), "Ideas: transfer caller is not owner nor approved");
        _safeTransfer(from, to, tokenId, _data);
    }

    function transferFrom(address from, address to, uint256 tokenId) public virtual override {
        require(_isApprovedOrOwner(_msgSender(), tokenId), "Ideas: transfer caller is not owner nor approved");
        _transfer(from, to, tokenId);
    }

    function balanceOf(address owner) public view virtual override returns (uint256) {
        require(owner != address(0), "Ideas: balance query for the zero address");
        return _balances[owner];
    }

    function ownerOf(uint256 tokenId) public view virtual override returns (address) {
        address owner = _box[tokenId].owner;
        require(owner != address(0), "Ideas: owner query for nonexistent token");
        return owner;
    }

    function ownerOfHash(string memory hash) public view virtual returns (address) {
        return ownerOf(_hashes[hash]);
    }

    function ideaOfHash(string memory hash) public view virtual returns (uint256) {
        return _hashes[hash];
    }

    function showSender() public view returns (address) {
        return msg.sender;
    }

    function get_txn_fees_percent() public view isAdmin returns (uint) {
        return txn_fees_percent;
    }

    function totalTokens() public view returns (uint256) {
        return _totalIdeas;
    }

    function metadataOf(uint256 id) public view virtual returns (string memory _name,
        string memory hash,
        uint256 block_time,
        uint256 price,
        address owner,
        address creator) {
        return metadataOfVersion(id, 0);
    }

    function metadataOfLatest(uint256 id) public view virtual returns (string memory _name,
        string memory hash,
        uint256 block_time,
        uint256 price,
        address owner,
        address creator) {
        Idea memory idea = _box[id];
        uint256 latest = idea.versions.length;
        return metadataOfVersion(id, latest - 1);
    }

    function metadataOfVersion(uint256 id, uint256 version) public view virtual returns
    (   string memory _name,
        string memory hash,
        uint256 block_time,
        uint256 price,
        address owner,
        address creator) {
        Idea memory idea = _box[id];
        Version memory ver = idea.versions[version];
        return (idea.name, ver.hash, ver.block_time, idea.price, idea.owner, idea.creator);
    }

    function userNameOf(address wallet) public view virtual returns (string memory) {
        require(wallet != address(0), "Ideas: user name for the zero address");
        return _wallets[wallet];
    }

    function walletOf(string memory _user) public view virtual returns (address) {
        return _users[_user];
    }

    function _safeMint(address to, uint256 tokenId, Idea memory idea, Version memory version) internal virtual {
        _mint(to, tokenId, idea, version);
        require(_checkOnERC721Received(address(0), to, tokenId, ""), "Ideas: transfer to non ERC721Receiver implementer");
    }

    function _mint(address to, uint256 tokenId, Idea memory idea, Version memory version) internal virtual {
        require(to != address(0), "Ideas: mint to the zero address");
        require(!_exists(tokenId), "Ideas: token already minted");

        _beforeTokenTransfer(address(0), to, tokenId);
        Idea storage stored_idea = _box[tokenId];
        stored_idea.name = idea.name;
        stored_idea.price = idea.price;
        stored_idea.owner = idea.owner;
        stored_idea.creator = idea.creator;
        stored_idea.versions.push(version);
        _balances[to] += 1;
        _hashes[version.hash] = tokenId;
        emit Transfer(address(0), to, tokenId);
    }

    function _safeTransfer(address from, address to, uint256 tokenId, bytes memory _data) internal virtual {
        _transfer(from, to, tokenId);
        require(_checkOnERC721Received(from, to, tokenId, _data), "Ideas: transfer to non ERC721Receiver implementer");
    }

    function _transfer(address from, address to, uint256 tokenId) internal virtual {
        Idea storage idea = _box[tokenId];

        require(idea.owner == from, "Ideas: transfer of token that is not own");
        require(to != address(0), "Ideas: transfer to the zero address");

        _beforeTokenTransfer(from, to, tokenId);
        _approve(address(0), tokenId);
        idea.owner = to;
        delete(idea.price);
        _balances[to] += 1;
        _balances[from] -= 1;
        emit Transfer(from, to, tokenId);
    }

    function _burn(uint256 tokenId) internal virtual {
        Idea memory idea = _box[tokenId];
        address owner = idea.owner;

        _beforeTokenTransfer(owner, address(0), tokenId);

        _approve(address(0), tokenId);
        delete _box[tokenId];
        _balances[owner] -= 1;
        for(uint256 i=0; i<idea.versions.length; i++) {
            delete(_hashes[idea.versions[i].hash]);
        }
        emit Transfer(owner, address(0), tokenId);
    }

    function _exists(uint256 tokenId) internal view virtual returns (bool) {
        return _box[tokenId].owner != address(0);
    }

    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }

    function _isEmpty(string memory str) private pure returns (bool) {
        return bytes(str).length == 0;
    }

    /*
    * All Approval related methods
    * These methods are responsible for delegating transaction rights
    * to a different account
    */

    function approve(address to, uint256 tokenId) public virtual override {
        address owner = ownerOf(tokenId);
        require(to != owner, "Ideas: approval to current owner");

        require(_msgSender() == owner || isApprovedForAll(owner, _msgSender()),
            "Ideas: approve caller is not owner nor approved for all"
        );

        _approve(to, tokenId);
    }

    function getApproved(uint256 tokenId) public view virtual override returns (address) {
        require(_exists(tokenId), "Ideas: approved query for nonexistent token");

        return _tokenApprovals[tokenId];
    }

    function setApprovalForAll(address operator, bool approved) public virtual override {
        require(operator != _msgSender(), "Ideas: approve to caller");

        _operatorApprovals[_msgSender()][operator] = approved;
        emit ApprovalForAll(_msgSender(), operator, approved);
    }

    function isApprovedForAll(address owner, address operator) public view virtual override returns (bool) {
        return _operatorApprovals[owner][operator];
    }

    function _isApprovedOrOwner(address spender, uint256 tokenId) internal view virtual returns (bool) {
        require(_exists(tokenId), "Ideas: operator query for nonexistent token");
        address owner = ownerOf(tokenId);
        return (spender == owner || getApproved(tokenId) == spender || isApprovedForAll(owner, spender));
    }

    function _approve(address to, uint256 tokenId) internal virtual {
        _tokenApprovals[tokenId] = to;
        emit Approval(ownerOf(tokenId), to, tokenId);
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC165, IERC165) returns (bool) {
        return interfaceId == type(IERC721).interfaceId
        || super.supportsInterface(interfaceId);
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal virtual { }

    function _checkOnERC721Received(address from, address to, uint256 tokenId, bytes memory _data)
    private returns (bool)
    {
        if (to.isContract()) {
        try IERC721Receiver(to).onERC721Received(_msgSender(), from, tokenId, _data) returns (bytes4 retval) {
        return retval == IERC721Receiver(to).onERC721Received.selector;
        } catch (bytes memory reason) {
        if (reason.length == 0) {
        revert("ERC721: transfer to non ERC721Receiver implementer");
        } else {
        assembly {
        revert(add(32, reason), mload(reason))
        }
        }
        }
        } else {
            return true;
        }
    }

}
